import React, { useState, useEffect } from 'react';
import { AuthenticatedTemplate, UnauthenticatedTemplate} from '@azure/msal-react';
import { useIsAuthenticated } from "@azure/msal-react";
import { SignInButton } from "./components/SignInButton";
import { SignOutButton } from "./components/SignOutButton";
import { Navbar}   from 'react-bootstrap';


import MenuG from './MenuG';

export default function App() {
  const [NickName, setNickName] = useState("");
  const isAuthenticated = useIsAuthenticated();

  const fetchData = async () => {
    const response = await fetch('http://wservicesdes.brazilsouth.cloudapp.azure.com/rest/WsRetActiveDirectoryAzure', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({
        Key: 'kfjshf84rwkjfsdklgfw49@254325jhsdgft',
        EntradaWs3: {
          BuscarPorDominioYusuario: {
            NickName: '',
            Dominio: ''
          },
          BuscarPorMail: {
            Mail: 'gpalmieri@socovesa.cl'
          },
          BuscarPorNombre: {
            Nombre: ''
          }
        }
      })
    });

    console.log('mensaje11111')

    const data = await response.json();
    //console.log(data.ParametrosSalidaWs4.Usuarios[0].ActiveDirectory.Noms + ' ' + data.ParametrosSalidaWs4.Usuarios[0].ActiveDirectory.Apes);
    //if (data.ColeccionDatosActiveDirectory && data.ColeccionDatosActiveDirectory.Cuentas) {
//      console.log('mensaje22222')
//      setNickName(data.ColeccionDatosActiveDirectory.Cuentas[0].CuentaDeUsuario.NickName)
//      console.log(data.ColeccionDatosActiveDirectory.Cuentas[0].CuentaDeUsuario.NickName)
    //}
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="Prueba" >
      <Navbar bg="dark" variant="dark" className="navbarStyle">
        <Navbar.Brand href="#home">
          &nbsp;&nbsp;Autenticaci√≥n
        </Navbar.Brand>
        <div className="collapse navbar-collapse justify-content-end">
          {isAuthenticated ? <SignOutButton /> : <SignInButton />}
        </div>
      </Navbar>
      <div className="App">
        <AuthenticatedTemplate>
          <div style={{ position: 'fixed', top: 0, left: 0, right: 0, bottom: 0 }}>
            {console.log("***************************************")}
            {fetchData()}
            <MenuG />
          </div>
        </AuthenticatedTemplate>
        <UnauthenticatedTemplate>
          <br></br>
          <br></br>
          <h5>
            <center> Por favor, ingrese sus credenciales para acceder al Sistema</center>
          </h5>
        </UnauthenticatedTemplate>
      </div>
    </div>
  );
}
